            zone = new PublicDomain.TzZone("WET", new PublicDomain.TzDataZone[] { new PublicDomain.TzDataZone("WET", new TimeSpan(0), "EU", "WE%sT", 0, 0, 0, null, new TimeSpan(0), null, null) }, new PublicDomain.TzDataRule[] { new PublicDomain.TzDataRule("EU", 1977, 1980, PublicDomain.Month.April, 1, DayOfWeek.Sunday, new TimeSpan(36000000000), "u", new TimeSpan(36000000000), "S", null), new PublicDomain.TzDataRule("EU", 1977, 1977, PublicDomain.Month.September, 0, DayOfWeek.Sunday, new TimeSpan(36000000000), "u", new TimeSpan(0), "-", null), new PublicDomain.TzDataRule("EU", 1978, 1978, PublicDomain.Month.October, 1, null, new TimeSpan(36000000000), "u", new TimeSpan(0), "-", null), new PublicDomain.TzDataRule("EU", 1979, 1995, PublicDomain.Month.September, 0, DayOfWeek.Sunday, new TimeSpan(36000000000), "u", new TimeSpan(0), "-", null), new PublicDomain.TzDataRule("EU", 1981, 2147483647, PublicDomain.Month.March, 0, DayOfWeek.Sunday, new TimeSpan(36000000000), "u", new TimeSpan(36000000000), "S", null), new PublicDomain.TzDataRule("EU", 1996, 2147483647, PublicDomain.Month.October, 0, DayOfWeek.Sunday, new TimeSpan(36000000000), "u", new TimeSpan(0), "-", null) });
            zones["WET"] = zone;
            zoneList.Add(zone);

            zone = new PublicDomain.TzZone("W-SU", new PublicDomain.TzDataZone[] { new PublicDomain.TzDataZone("W-SU", new TimeSpan(90200000000), "-", "LMT", 0, 0, 0, null, new TimeSpan(0), null, null) }, new PublicDomain.TzDataRule[] { });
            zones["W-SU"] = zone;
            zoneList.Add(zone);

            zone = new PublicDomain.TzZone("Zulu", new PublicDomain.TzDataZone[] { new PublicDomain.TzDataZone("Zulu", new TimeSpan(0), "-", "UTC", 0, 0, 0, null, new TimeSpan(0), null, null) }, new PublicDomain.TzDataRule[] { });
            zones["Zulu"] = zone;
            zoneList.Add(zone);

            #endregion

            Zones = ReadOnlyDictionary<string, TzZone>.AsReadOnly(zones);
